                    </li>
                </ul>
            </div>
        )
    };

    const adminRightSide =() => {
        //
    };



    return (

       <Base title="Welcome to Admin area" description="Manage all of your products here"  className="container bg-success p-4"> 
       <div className="row">
           <div className="col-3">
               {adminLeftSide()}
           </div>
           <div className="col-9">
               {adminRightSide()}
           </div>
       </div>

       </Base>

    )
};





export default AdminDashBoard;
